import React from 'react'
import s from '../SortingBlock.module.css'

export default function FilterForm() {
  const filter = e => {
    e.preventDefault()

  }

  return (
    <div>
        <p className={s.sorting_title}>Price</p>
        <form className={s.sorting_section} onSubmit={filter}>
            <p className={s.sorting_title}>Price</p>
            <input type='number' placeholder='from' name='from' className={s.price_input} />
            <input type='number' placeholder='to' name='to' className={s.price_input} />
        </form>                
    </div>
  )
}
